import React from 'react';

const MenuEcommerce = () => {
  const categorias = ['Electrónica', 'Ropa', 'Accesorios', 'Hogar'];

  const handleClick = (categoria) => {
    // Aquí puedes manejar el evento de clic en la categoría seleccionada
    console.log(`Categoría seleccionada: ${categoria}`);
  };

  return (
    <div>
      <h2>Menú E-commerce</h2>
      <ul>
        {categorias.map((categoria, index) => (
          <li key={index} onClick={() => handleClick(categoria)}>
            {categoria}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default MenuEcommerce;
